import React, { useState } from "react";

const Clock = () => {
  let Time = new Date().toLocaleTimeString();
  const [curTime, UpTime] = useState(Time);

  const setTime = () => {
    Time = new Date().toLocaleTimeString();
    UpTime(Time);
  };
  return (
    <>
      <h1>{curTime}</h1>
    </>
  );
};

export default Clock;
